import React from 'react'
import logo from '../../logo.jpg';

const styles = StyleSheet.create({
    buttonContainer: {
      position: 'absolute',
      top: 20,
      left: 40
    }
  })

const Header = () => (
    <nav className="navbar">
        <ul>
            <li><a href="#home">Chess7</a></li>
            <li style={styles.buttonContainer}><a class="active" href="identification.html">S'identifier</a></li>
            <li style={styles.buttonContainer}><a class="active" href="#inscription">S'inscrire</a></li>
          </ul> 


        <img src={logo} className="App-logo" alt="logo" />
    </nav>
)
export default Header
